import { AddingElement } from "./AddingElement";
import { ShowDelete } from "./ShowDelete";


//Style Of Component
import './creationList.scss';

const CreationList = () => {


	const [listComplete,setListComplete ]=useState( [ ] )



	return(
		<div className="todolist-creationlist">
			<div className="creationlist-table-container">  
				<div  className="creationlist-title" >
						<h1>TO DO LIST</h1>
				</div>
				<AddingElement listComplete={listComplete} setListComplete={setListComplete} /> 
				<ShowDelete  listComplete={listComplete} setListComplete={setListComplete}  />  
			</div> 
		</div>
	)
}

